import React from "react";
import "./style.css";
function Form(props) {
  return (
    <div>
      <input
        className="orolt"
        type="text"
        onkeyup="this.value=this.value.replace(/[^\d]/,'')"
        placeholder={props.placeholder}
        id={props.id}
        onChange={props.changed}
      />
    </div>
  );
}
export default Form;
